import React from 'react';



const Pad = (props) =>{
  console.log("Rendering Pad")
  return(
    <button  onClick={props.sendKey} className={props.activated? 'drum-pad activated': 'drum-pad'} value={props.parLetter}> {props.parLetter}
      <audio src={props.parSound} className="aud"  id={props.parLetter}></audio> 
    </button>
  );
}


export default Pad;
